import React from 'react';
import Highlight from '../components/highlight/Highlight';

const Home = () => (
    <>
        <div className="Home">
            <div className="container">
                    <Highlight/>
                    <Highlight/>
                    <Highlight/>
            </div>
        </div>
        <style jsx>
            {`
                .Home .container {
                    background-color: #2a2b30;
                }
            `}
        </style>
    </>
)
export default Home;
